import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Nav from './components/Nav';
import Home from './pages/Home';
import Footer from './components/Footer';

const App = () => {
  return (
    <>
      <Router>

      </Router>
      <Nav />
      <Home />
      <Footer />
      <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </>
  );
}

export default App;
